(1, 'condition.php', 'Terms & Conditions', 'Terms and conditions page', '        <p>Bajaree.com ("we," "us," "our") has established these Terms of Use ("Terms") for each customer ("you," "your"), which govern your access to, and use of the www.bajaree.com website (the "Services"), and any information, text, graphics, or other materials uploaded, downloaded, or appearing on the Services (collectively referred to as "Content"). By accessing or using the Services you agree to be bound by these Terms.</p>\r\n        \r\n        <h4>Use of the Services</h4>\r\n        \r\n<p>The Company grants you a single, non-exclusive, limited personal license to access and use the Services conditioned on your continued compliance with these Terms. This license is for the sole purpose of enabling you to use and enjoy the benefit of the Services as provided by the Company, in the manner permitted by these Terms. You may not transfer or share your right to access or use the Services.</p>\r\n\r\n<p>You may use the Services if you are of legal age to form a binding contract and are not a person barred from receiving services under the laws of the Republic of Singapore. You may use the Services only in compliance with these Terms and all applicable local, state, national, and international laws, rules and regulations.</p>\r\n\r\n<p>All right, title, and interest in and to the Services are and will remain the exclusive property of the Company and its licensors. The Services are protected by copyright, trademark, and other laws, of both the Republic of Singapore and foreign countries. Nothing in the Terms gives you a right to use the Company''s name or any of the Company''s trademarks, logos, domain names, and other distinctive brand features, and you may not use the same without our express written permission. Any feedback, comments, or suggestions ("Submission") you may provide regarding the Services is entirely voluntary and we will be free to use such Submission as we see fit and without