(6, 'http://localhost/bajaree/corporate.php', 'Sign up for a Corporate Account', 'Corporate Accounts', '<div class="col-md-6">\r\n<div class="blockContent">\r\n<h3>Sign up for a Corporate Account</h3>\r\n<p>If you are a business, organization, retailer or similar based in Singapore and want a great deal on pantry and other supplies, Bajaree''s got it! Over 4,000 food, beverage, cleaning and other products in stock, at great prices, and with an additional 2% off for approved corporate accounts!</p>\r\n<img class="img-responsive" style="margin-top: 20px;" src="http://localhost/bajaree/upload/file_manager/corporateAccount-img.png" alt="" /></div>\r\n</div>\r\n<div class="col-md-6">\r\n<div class="blockContent">\r\n<h3>Apply for a Corporate Account below - if approved we''ll contact you within 3 business days and get you set up and ready to order!</h3>\r\n<h4>Apply for a Corporate Account now and get:</h4>\r\n<ul>\r\n<li>An additional 2% off Bajaree''s already low prices</li>\r\n<li>Can order via email, fax, or phone, in addition to the Bajaree website</li>\r\n<li>Can place bulk orders of products</li>\r\n<li>Can apply for credit terms</li>\r\n<li>Special delivery queue to ensure you get your order when you need it</li>\r\n</ul>\r\n<h4>Bajaree Corporate Account Application</h4>\r\n<p>Thank you for your interest in ordering with Bajaree. To be considered for a corporate account, please provide all the information requested. We will contact approved accounts via the email supplied within 3 business days.</p>\r\n<!--                <button style="margin-top:20px;" class="btn btn-default btn-primary" type="submit">Submit</button>--></div>\r\n</div>', 'Corporate Accounts', 'Corporate Accounts', 'Corporate,Accounts', 5, 'user-created'),
(7, 'http://localhost/bajaree/sell-on-bajaree.php', 'Sale on Bajaree', 'Sale on Bajaree', '<div class="col-md-6">\r\n<div class="blockContent">\r\n<h3>Sell on Bajaree</h3>\r\n<p>Impressed with what you see? If you''re a CPG manufacturer or distributor and are interested in featuring your products on Bajaree, please contact us via the form below. We are always on the lookout for new products and are constantly adding new manufacturers and brands.</p>\r\n<img class="img-responsive" style="margin-top: 20px;" src="http://localhost/bajaree/upload/file_manager/navFoodCupboard.jpg" alt="" /></div>\r\n</div>\r\n<div class="col-md-6">\r\n<div class="blockContent">\r\n<h3>Besides beautifully showcasing your products, Bajaree offers you several benefits compared to traditional brick-and-mortar retailers:</h3>\r\n<ul>\r\n<li>A direct-2-consumer channel without private label competition</li>\r\n<li>No listing fees</li>\r\n<li>Ability to set your own prices</li>\r\n<li>Can apply for credit terms</li>\r\n<li>Plenty of consumer purchasing behavior data, including pre-point of sale insights</li>\r\n</ul>\r\n<p>Sound good? Get in touch today! We''d love to hear from you.</p>\r\n<form class="form">\r\n<div class="form-group"><label for="exampleInputEmail1">Email Address *</label> <input id="exampleInputEmail1" class="form-control" type="email" placeholder="Enter email" /></div>\r\n<div class="form-group"><label for="exampleInputPassword1">Message *</label> <textarea class="form-control" rows="3"></textarea></div>\r\n<button class="btn btn-primary" type="submit">Submit</button></form></div>\r\n</div>', 'Sale on Bajaree', 'Sale on Bajaree', 'Sale on Bajaree', 5, 'user-created');
